import { Layout, Typography } from "antd";


const { Title } = Typography;
const { Content } = Layout;


const TrangChu = () => {
    return (
        <Layout>
            <Content>
                <div>
                    <Title level={2}>Trang Chu</Title>
                </div>
            </Content>
        </Layout>
    );
}
export default TrangChu;
